        console.info('=> Headers:', options.headers)

        this.networkData.headers = options.headers
      }

      if (options.params) {
        console.info('=> Params:', options.params)
      }

      if (options.data) {
        console.info('=> Data:', options.data)

        this.networkData.data = options.data
      }

